gad6(){return"Not just a Monument,"},
gad5(){return"but a Symbol of Love."},
gad4(){return"Suman Pokhrel"},
gad7(){return"The Taj Mahal rises above the banks of the river like a solitary tear suspended on the cheek of time."},
gad8(){return"Rabindranath Tagore"},
gacW(){return"The Taj Mahal is distinguished as the finest example of Mughal architecture, a blend of Indian, Persian, and Islamic styles."},
gacX(){return"It took the efforts of 22,000 laborers, painters, embroidery artists and stonecutters to shape the Taj Mahal."},
gadc(){return"\u201cIndia\u2019s Taj Mahal Is an Enduring Monument to Love | National Geographic.\u201d Youtube, uploaded by National Geographic."},
gad3(){return"Map showing location of Taj Mahal in Uttar Pradesh, India."},
gad_(){return"The Taj Mahal is an ivory-white marble mausoleum on the right bank of the river Yamuna in the Indian city of Agra. It was commissioned in 1632 CE by the Mughal emperor Shah Jahan (r. 1628-1658) to house the tomb of his favorite wife, Mumtaz Mahal; it also houses the tomb of Shah Jahan himself."},
gad0(){return"The tomb is the centerpiece of a 42-acre (17-hectare) complex, which include twin mosque buildings (placed symmetrically on either side of the mausoleum), a guest house, and is set in formal gardens bounded on three sides by walls."},
gacY(){return"The Taj Mahal was constructed using materials from all over India and Asia. It is believed over 1,000 elephants were used to transport building materials.\nThe translucent white marble was brought from Rajasthan, the jasper from Punjab, jade and crystal from China. The turquoise was from Tibet and the lapis from Afghanistan, while the sapphire came from Sri Lanka. In all, twenty-eight types of precious and semi-precious stones were inlaid into the white marble."},
